import React from 'react';
import {Form,Label,Input,Button} from 'reactstrap';
import axios from 'axios';

export const Contact = () => {

  const handleSubmit = (e) => {
    e.preventDefault();
    const name = document.getElementById('name').value;
    const email = document.getElementById('email').value;
    const message = document.getElementById('message').value;
    axios({
        method: "POST", 
        url:"http://localhost:3002/contact", 
        data: {
            name: name,   
            email: email,  
            messsage: message
        }
    }).then((response)=>{
        if (response.data.msg === 'success'){
            alert("Message Sent."); 
            resetForm();
        }else if(response.data.msg === 'fail'){
            alert("Message failed to send.")
        }
    })
}

  const resetForm = () => {
    document.getElementById('contact-form').reset();
}


    return (
      <>
      <div className="contentSection contactDiv">
      <div className="Card mb-3 mt-3">
        <div className="Row no-gutters">
          <div className="Col-lg-12">
            <div className="CardBody">


              <div className="Card mb-3 CardContent">
                <div className="Row no-gutters">
                  <div className="Col-lg-12">
                    <div className="CardBody">
                      <h4 className="Card-title" id="contactTitle">LEAVE A MESSAGE - </h4> <br />
                      <div className="Card-text">
                        <Form id="contact-form" onSubmit={handleSubmit} method="POST" action="/contact">
                          <Label for="name" className="contact-label">Name :</Label> 
                          <Input id="name" type="text" placeholder="Enter your Name." className="contact-form form-control-lg" name="senderName" autocomplete="off"/> <br />
                          <Label for="email" className="contact-label">Email id :</Label> 
                          <Input id="email" type="email" placeholder="Enter your email id." className="contact-form form-control-lg" name="email" autocomplete="off" /> <br />
                          <Label for="message" className="contact-label">Message :</Label>
                          <textarea id="message" name="msgVal"  Cols="60" Rows="6" placeholder="Type a message " className="contact-form"></textarea>
                          <Button type="submit" className="btn btn-lg" id="sendBtn">Send Message</Button>
                        </Form>
                      </div>
                    </div>
                  </div>
                </div>
              </div>

            </div>
          </div>
        </div>
      </div>
    </div>

    <div className="contentSection contactDiv">
    <div className="Card mb-3 card-content">
                <div className="row no-gutters">
                  <div className="col-lg-12">
                    <div className="card-body">
                      <h4 className="card-title" id="contactTitle">OR REACH ME AT - </h4>
                      <div className="card-text" style={{textAlign:"center"}}>
                      <a href="tel:+91-7276072667" className="Link"><i className="fa fa-phone-square fa-2x" title="+91 7276072667"></i></a> <span> &nbsp; </span>
                      <a href="mailto:maithiaharsh@gmail.com" className="Link"><i className="fa fa-envelope fa-2x" title="maithiaharsh@gmail.com"></i></a> <span> &nbsp; </span>
                      <a href="#" className="Link"><i className="fa fa-linkedin fa-2x" title="linkdin"></i></a>

                      </div>
                    </div>
                  </div>
                </div>
              </div>
    </div>

    </>
    )
}
